namespace SINoVision
{
    public class MLClassifierWeaponType
    {
        private int NumHidden = 40;
        private int NumOutputs = 5;

        private float[] WeightH1 = null;
        private float[] BiasH1 = null;
        private float[] WeightOut = null;
        private float[] BiasOut = null;

        public int Calculate(float[] input, out float BestPct)
        {
            float[] layer1 = new float[NumHidden];
            MLUtils.CalcNetworkLayer(input, layer1, WeightH1, BiasH1);
            MLUtils.ApplySigmoid(layer1);
            
            float[] output = new float[NumOutputs];
            MLUtils.CalcNetworkLayer(layer1, output, WeightOut, BiasOut);
            MLUtils.ApplySoftmax(output);

            return MLUtils.PickHighestProbability(output, out BestPct);
        }

